import React from 'react'
import Svg, { Path, Rect } from 'react-native-svg';

const sidebar = () => {
    return (
        <Svg id="Layer_1" data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 132.59 123.46">
            <Rect x="0" y="0" width="132.59" height="22.35" rx="11.18" ry="11.18" />
            <Rect x="0" y="50.56" width="132.59" height="22.35" rx="11.18" ry="11.18" />
            <Path d="M11.18,123.46C5,123.46,0,118.46,0,112.29H0c0-6.17,5-11.18,11.18-11.18H121.41c6.17,0,11.18,5,11.18,11.18h0c0,6.17-5,11.18-11.18,11.18" />
        </Svg>
    )
}
export default sidebarIcon;
